'Dharti' is family drama set in Punjab on the  
backdrop of Punjab Politics. Baljit Singh      
Wadala is the head of ruling party in Punjab   
and has two sons. The elder son Vikramjit      
Singh Wadala is following his father's         
footsteps and is a prominent political leader, 
while the younger son Jasdeep Singh Wadala is  
a Squadron Leader in the Indian Air Force. The 
younger son has a conflict with his father as  
he had left his father's legacy to join the    
Indian Air Force. Due to certain circumstance  
Jasdeep Singh is forced to come to Punjab.     


